import React from 'react';
import logo from './logo.svg';
import './Menu.css';
import MenuOption from './MenuOption';

class Menu extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            menuOptions: ["Upload Packages", "REAST API"],
        };
    }

    renderOptions(options) {
        return(
            <MenuOption
                value={option}>
            </MenuOption>
        );
    }

    render() {
        const currentOptions = this.state.menuOptions;

        menuOptions = Array(0);

        for(const option in currentOptions) {
            menuOptions.push(<MenuOption
                value={option}>
            </MenuOption>);
        }

        return(
            <div className="menu">
                {this.renderOptions(currentOptions)}
            </div>
        );
    }
}

export default Menu;
